import axios from "axios";
import React, {useEffect, useState} from 'react';
import GroupList from '../components/GroupList'


function Home(){
    const [flag, setFlag] = useState(false)
    const [groupList, setGroupList] = useState([])

    const changeFlag = () =>{
      setFlag(!flag)
    }
    useEffect(() => {
      const load_g = async ()=>{
        const res = await axios.get('http://127.0.0.1:8000/api/groups/')
        await setGroupList(JSON.stringify(res.data))
      }
      load_g()
  
    }, [flag, groupList])

    return(
    <section className="Home">
      <div className="owned-groups">
      {groupList?.map(group =>{
        return <GroupList name = {group.name} description = {group.description} changeFlag = {changeFlag}/>
        })}
      </div>
    </section>
      )
  }

  export default Home;
